// /****************************

function generateMarkers(arr) {
  let id = 0;
  arr.forEach(function (element) {
    element.id = id;
    const idString = id.toString();
    L.marker(element.latLong, {
      icon: myDefaultMarker,
      customId: idString,
      title: element.placeName
    })
      .addTo(mymap)
      .on("click", markerClick)
      .bindPopup(`<b>${element.placeName}</b><br>${element.altPlaceName}`);
    markers[id] = element;
    id += 1;
  });
}
generateMarkers(data1);
