      description:
        "Tanjung Raja adalah sebuah kecamatan tertua di Kabupaten Ogan Ilir, Sumatera Selatan, Indonesia. Awal mulanya kecamatan ini meliputi Kecamatan Rantau Alai, Rantau Panjang, Sungai Pinang, dan beberapa desa yang sekarang menjadi wilayah Kecamatan Indralaya Selatan. Letak Kecamatan ini strategis terletak di jalur perlintasan timur Sumatera menjadikan wilayahnya sebagai Kota Transit. Salah satu yang menjadikan icon kecil kecamatan ini adalah Pindang Tulang Pegagan-nya yang terkenal lezat dan sedap. Penduduk kecamatan Tanjung Raja mayoritas bekerja sebagai petani, dan sebagian kecil sebagai PNS serta penduduk di wilayah ini bersuku bangsa Pegagan, Kayuagung, dan jawa, sedangkan bahasa yang digunakan oleh masyarakat sehari-hari adalah Bahasa Indonesia, Bahasa Palembang, Bahasa Pegagan, dan Kayuagung.",
