function style(feature) {
  return {
    color: feature.properties.color || '#000000', // Default to black if no color is specified
    weight: 2,        // Set the border weight
    fillColor: feature.properties.color || '#000000', // Set the fill color
    fillOpacity: 0.5  // Set the fill opacity
  };
}

function onEachFeature(feature, layer) {
  layer.on({
    click: function(e) {
      markerClick2(feature);
    }
  });
}

function markerClick2(feature) {
  $(".card-img").attr("src", feature.informations.imgUrl);
  $(".card-title").html(feature.informations.placeName);
  $(".card-subtitle").html(feature.informations.description);
  $(".card-text").html(feature.informations.cardText);
  let items = $(".card-list-group li");
  for (let i = 0; i < 4; i++) {
    const span = $('<span class="card-list-group-item">Diet:</span>').html(
      feature.informations.cardList[i][0]
    ); //global?
    $(items[i]).html(feature.informations.cardList[i][1]).prepend(span);
  }
}

L.geoJson(stateData, {
  style: style,
  onEachFeature: onEachFeature
}).addTo(mymap);

